import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import styled from "styled-components";

// Components
import { Button, Input } from "../components";

function Login() {
  return (
    <Container>
      <Content>
        <BoxLoginImput>
          <div>
            <img src="/assets/logo.svg" />
          </div>
          <div>
            <p class="title">Buscar usuário</p>
            <p class="infor">Crie sua conta através do seu usuário do GitHub</p>
            <Input content="Email" />
            <Button content="Cadastrar" />
          </div>
          <Link to="/Empresa">About</Link>
        </BoxLoginImput>
        <BoxLoginArt>
          <div>
            <img src="/assets/art.svg" />
          </div>
        </BoxLoginArt>
      </Content>
    </Container>
  );
}
const Container = styled.div`
  display: flex;
  height: 100%;
  background: #ededed;
  width: 100%;
  align-items: center;
  justify-content: center;
  position: fixed;
`;
const Content = styled.div`
  display: flex;
  height: 400px;
  background: #fff;
  width: 650px;
  border-radius: 10px;
  box-shadow: 0px 0px 5px #cfcfcf;
`;
const BoxLoginImput = styled.div`
  display: flex;
  height: 100%;
  flex: 1;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  border-radius: 10px 0px 0px 10px;
  background: #fff;
  div {
    display: flex;
    justify-items: center;
    justify-content: center;
    align-items: center;
    flex: 1;
    flex-direction: column;
    p {
      display: flex;
      width: 90%;
      justify-items: start;
    }
    p.title {
      font-size: 20px;
      font-weight: bold;
      margin: 0px 0px px 0px;
    }
    p.infor {
      font-size: 12px;
      color: gray;
    }
    img {
      width: 160px;
    }
  }
`;
const BoxLoginArt = styled.div`
  display: flex;
  height: 100%;
  flex: 1.3;
  border-radius: 0px 10px 10px 0px;
  background: black;
  justify-items: center;
  align-items: center;
  div {
    width: 100%;
    img {
      width: 100%;
    }
  }
`;
export default Login;
